"""Use the [Requests](https://fedbiomed.org/latest/developer/api/researcher/requests/#fedbiomed.researcher.requests.Requests) Fed-BioMed class to list all available datasets."""

import torch
import torch.nn as nn
import torch.nn.functional as F
from torch.utils.data import DataLoader
from fedbiomed.data import MedicalFolderDataset
from fedbiomed.data.transforms import ToTensor  # Fed-BioMed's ToTensor for medical data
from torchvision import transforms
from skimage.morphology import binary_fill_holes
import numpy as np
from torch.nn import Conv2d, ConvTranspose2d, ReLU, ModuleList, Sequential, MaxPool2d

# Custom Dice loss
def dice_loss(pred, target, smooth=1.0):
    pred = torch.sigmoid(pred)
    iflat = pred.contiguous().view(-1)
    tflat = target.contiguous().view(-1)
    intersection = (iflat * tflat).sum()
    union = iflat.sum() + tflat.sum()
    return 1 - ((2. * intersection + smooth) / (union + smooth))

# Custom target transform to fill circumference to full head
class FillHeadMask:
    def __call__(self, mask):
        mask_np = mask.squeeze().numpy()
        # Binarize and fill holes (assumes contour is boundary)
        binary_mask = mask_np > 0.5
        filled = binary_fill_holes(binary_mask).astype(np.float32)
        return torch.from_numpy(filled).unsqueeze(0)  # (1, H, W)

# U-Net model (lightweight as per hint)
class UNet(nn.Module):
    def __init__(self, in_channels=1, out_channels=1, features=[20, 40, 80, 160]):
        super(UNet, self).__init__()
        self.downs = ModuleList([self._conv_block(in_channels, features[0])])
        in_ch = features[0]
        for feature in features[1:]:
            self.downs.append(self._conv_block(in_ch, feature))
            in_ch = feature
        self.pool = MaxPool2d(kernel_size=2, stride=2)

        self.bottleneck = self._conv_block(features[-1], features[-1] * 2)

        self.ups = ModuleList()
        for feature in reversed(features):
            self.ups.append(
                Sequential(
                    ConvTranspose2d(feature * 2, feature, kernel_size=3, stride=2, padding=1, output_padding=1),
                    self._conv_block(feature * 2, feature)
                )
            )

        self.final_conv = Conv2d(features[0], out_channels, kernel_size=1)

    def _conv_block(self, in_ch, out_ch):
        return Sequential(
            Conv2d(in_ch, out_ch, 3, padding=1),
            ReLU(inplace=True),
            Conv2d(out_ch, out_ch, 3, padding=1),
            ReLU(inplace=True)
        )

    def forward(self, x):
        skip = []
        for down in self.downs:
            x = down(x)
            skip.append(x)
            x = self.pool(x)

        x = self.bottleneck(x)
        skip = skip[::-1]

        for idx, up in enumerate(self.ups):
            x = up(x)
            x = torch.cat((x, skip[idx]), dim=1)

        return self.final_conv(x)

class FetusSegmentationPlan(torch.nn.Module):  # Inherit from TorchTrainingPlan
    def __init__(self, model_args):
        super(FetusSegmentationPlan, self).__init__(model_args)

    def init_model(self, **kwargs):
        return UNet(in_channels=1, out_channels=1)

    def init_optimizer(self, **kwargs):
        return torch.optim.Adam(self.model().parameters(), lr=kwargs["lr"])

    def init_loss_fn(self):
        def loss_fn(pred, target):
            bce = F.binary_cross_entropy_with_logits(pred, target)
            d = dice_loss(pred, target)
            return bce + d  # Combined loss
        return loss_fn

    def training_data(self):
        # Transforms: normalize image to [0,1], fill mask
        data_transform = transforms.Compose([ToTensor()])
        target_transform = transforms.Compose([
            ToTensor(),
            FillHeadMask()
        ])

        dataset = MedicalFolderDataset(
            root=self.dataset_path,
            data_modalities=["ultrasound"],
            target_modalities=["segmentation"],
            transform=data_transform,
            target_transform=target_transform
        )
        return DataLoader(dataset, batch_size=self.batch_size, shuffle=True)

    def training_step(self, model, batch):
        inputs, targets = batch
        images = inputs[0]["ultrasound"]  # Ignore demographics: inputs = (dict(modalities), dict(demographics))
        preds = model(images)
        loss = self.loss_fn()(preds, targets["segmentation"])
        return {"loss": loss}

# Note: This is a TorchTrainingPlan subclass; register if needed, but in Experiment it's passed as class
from fedbiomed.training_plan import TorchTrainingPlan
FetusSegmentationPlan = TorchTrainingPlan(FetusSegmentationPlan)  # Wrap if required

"""## 4.2 - Create a Training Plan

You will now create a [training plan](https://fedbiomed.org/latest/user-guide/researcher/training-plan/) that incorporates your chosen model to solve the segmentation task.
<br>

### A. Define your model
---

Inside the `init_model` function, create your pytorch model object, and return it.

**Important note**:

Ultrasound image segmentation is a challenging task. Ultrasound scans often suffer from low contrast, noise, and variable quality depending on the acquisition setup and operator. This makes it difficult for models to clearly separate anatomical structures such as the fetus head.

You are free to design your segmentation network using any PyTorch model architecture. You can take inspiration from previous works, such as the model implemented in [this](https://github.com/pranjalrai-iitd/Fetal-head-segmentation-and-circumference-measurement-from-ultrasound-images/tree/master) repository. However, be careful not to use a very large model, since training in Colab can be quite slow and Fed-BioMed does not currently support GPU acceleration in this environment.

As a hint, we tried to solve this task with a 2D U-Net model designed for binary segmentation, with single-channel images as input, and two-class masks as output. The encoder has four levels, with the number of convolutional filters doubling at each stage (20, 40, 80, and 160 filters), and using convolution kernels of size 3. Downsampling is achieved with strides of 2 at each level. The decoder mirrors the encoder structure and performs upsampling using up-convolutions with a kernel size of 3. For training, we used Adam optimizer with a learning rate of 0.01. Training was carried out with a batch size of 5, for 5 updates per round, across 50 rounds of federated learning. Even with this lightweight setup, training took around 30 minutes. The resulting performance reached about 0.7 Dice score on training data and 0.6 on testing data, which is not very high but still we have been able to check that the model is learning.

No worries if your results are not excellent. The goal of this tutorial is not to achieve state-of-the-art performance, but to assess your understanding of federated learning and your ability to use Fed-BioMed effectively.
<br>

### B. Define an optimizer
---

Inside the `init_optimizer` function, define an optimizer that will be used during training steps.
<br>

### C. Define your loss function
---

Define the loss function that will be minimized during training steps.

Do not forget that the task is a binary segmentation task for which several loss functions can be used. Common choices are Binary Cross-Entropy (BCE) loss or overlap-based losses like the Dice loss. In practice, many approaches combine losses, such as BCE + Dice, to balance pixel-level accuracy with region-level overlap.
<br>

### D. Define your training data
---

We will use Fed-BioMeds built-in class for image segmentation tasks: MedicalFolderDataset. This class supports loading a set of patient demographics data in csv format, in addition to the imaging data.

The inputs to the `__init__` function are:
- **root**: the filesystem path where the root of the dataset is located (`self.dataset_path` in the training plan)
- **data_modalities**: the names of the modalities of interest for the input data
- **target_modalities**: the names of the modalities of interest for the data to be predicted
- **transform**: optional transformations to be performed on the input images
- **target_transform**: optional transformations to be performed on the target data
- **demographics_transform**: optional transformations to be performed on the demographics (csv) data. You will probably not need it.

You will probably ignore the values of the demographics data during training if your segmentation model only takes images as input.

**Note**:

The raw input label provided is a head circumference mask, so you may need to pre-process the data to obtain a full segmentation mask for training. For this prupose, several helper functions exist from scipy or opencv for example. Additionally, be careful with data types and label values to ensure consistency, and consider standardizing image and mask shapes so that all inputs to the model have the same dimensions.
<br>

### E. Define training step
---

In the `training_step` function, we take as input one batch of `(input, target)` provided by the Fed-BioMed DataLoader, train the model and compute the loss function.

Note that the MedicalFolderDataset class returns data as a tuple of (input, target), where:
- input is a tuple of (image_modalities, demographics),
- target is a dict of {modality: image} (after target transformations),

and where:
- image_modalities is a dict of {modality: image} (after image transformations),
- demographics is a dict of {column_name: values} where the column names are taken from the demographics csv file (after demographics transformations).

As already explained, you will probably ignore the values of the demographics data.
<br>

### F. Define your dependencies
---

Do not forget to declare every library or module you plan to use inside the `init_dependencies`.
"""

import torch
import torch.nn as nn
import torch.nn.functional as F
from torch.utils.data import DataLoader
from fedbiomed.data import MedicalFolderDataset
from fedbiomed.data.transforms import ToTensor  # Fed-BioMed's ToTensor for medical data
from torchvision import transforms
from skimage.morphology import binary_fill_holes
import numpy as np
from torch.nn import Conv2d, ConvTranspose2d, ReLU, ModuleList, Sequential, MaxPool2d

# Custom Dice loss
def dice_loss(pred, target, smooth=1.0):
    pred = torch.sigmoid(pred)
    iflat = pred.contiguous().view(-1)
    tflat = target.contiguous().view(-1)
    intersection = (iflat * tflat).sum()
    union = iflat.sum() + tflat.sum()
    return 1 - ((2. * intersection + smooth) / (union + smooth))

# Custom target transform to fill circumference to full head
class FillHeadMask:
    def __call__(self, mask):
        mask_np = mask.squeeze().numpy()
        # Binarize and fill holes (assumes contour is boundary)
        binary_mask = mask_np > 0.5
        filled = binary_fill_holes(binary_mask).astype(np.float32)
        return torch.from_numpy(filled).unsqueeze(0)  # (1, H, W)

# U-Net model (lightweight as per hint)
class UNet(nn.Module):
    def __init__(self, in_channels=1, out_channels=1, features=[20, 40, 80, 160]):
        super(UNet, self).__init__()
        self.downs = ModuleList([self._conv_block(in_channels, features[0])])
        in_ch = features[0]
        for feature in features[1:]:
            self.downs.append(self._conv_block(in_ch, feature))
            in_ch = feature
        self.pool = MaxPool2d(kernel_size=2, stride=2)

        self.bottleneck = self._conv_block(features[-1], features[-1] * 2)

        self.ups = ModuleList()
        for feature in reversed(features):
            self.ups.append(
                Sequential(
                    ConvTranspose2d(feature * 2, feature, kernel_size=3, stride=2, padding=1, output_padding=1),
                    self._conv_block(feature * 2, feature)
                )
            )

        self.final_conv = Conv2d(features[0], out_channels, kernel_size=1)

    def _conv_block(self, in_ch, out_ch):
        return Sequential(
            Conv2d(in_ch, out_ch, 3, padding=1),
            ReLU(inplace=True),
            Conv2d(out_ch, out_ch, 3, padding=1),
            ReLU(inplace=True)
        )

    def forward(self, x):
        skip = []
        for down in self.downs:
            x = down(x)
            skip.append(x)
            x = self.pool(x)

        x = self.bottleneck(x)
        skip = skip[::-1]

        for idx, up in enumerate(self.ups):
            x = up(x)
            x = torch.cat((x, skip[idx]), dim=1)

        return self.final_conv(x)

