"""## 4.7 - Perform internal validation

Check what is the aggregated model's performance on the node_1 and node_2 holdout datasets:
- compute the average Dice score (and standard deviation) obtained by your model
- plot an illustration of yourt model output on one image.
"""

def dice_score(pred, target, smooth=1.0):
    pred = torch.sigmoid(pred) > 0.5
    intersection = (pred * target).sum(dim=(1,2,3)).float()
    union = pred.sum(dim=(1,2,3)).float() + target.sum(dim=(1,2,3)).float()
    dice = (2. * intersection + smooth) / (union + smooth)
    return dice.mean().item()

